import "./Header.css";

const Header = () => {
  return (
    <div>
      <h3 className=".header-title">Choigonyok</h3>
      <h3>Project</h3>
      <h3>Study</h3>
      <h3>Review</h3>
    </div>
  );
};

export default Header;
